$(function(){
           var t = $("#text_box");
           $("#add").click(function(){
               t.val(parseInt(t.val())+1)
               if (parseInt(t.val())!=1){
                   $('#min').attr('disabled',false);
               }
           })
           $("#min").click(function(){
               t.val(parseInt(t.val())-1)
               if (parseInt(t.val())==1){
                   $('#min').attr('disabled',true);
               }
               if(parseInt(t.val())==0){
                   alert("Quantity can not be less than 1 !");
                   t.val(parseInt(t.val())+1)
               }
           })
       })

form.script:
   function update_helpful(id)
{
    $.ajax({
        type: "GET",//Get method or post method
        url: "http://www.obodohomecraft.com/index.php?main_page=product_reviews_info",//server script pathurl
        dataType:"json",//the data type of return(xml,html or text)
        data: {products_id: 310, action:'update', reviews_id:id},
        error:function(text){
            alert('server error');
        },
        success:function(result){
            if(result.status==1){
                alert(result.message);
            }else{
                $('#finger_'+id).html('helpful '+result.total+'');
            }
        }
    });
}
